import Vue from 'vue'
import App from './App.vue'
import router from './router'
import vuetify from './plugins/vuetify'
import VueGtag from 'vue-gtag'

Vue.config.productionTip = false

Vue.use(VueGtag, {
    config: {
        id: 'G-C46GHMNNV6',
        params: {
            send_page_view: false
        }
    }
}, router)

new Vue({
  router,
  vuetify,
  render: h => h(App)
}).$mount('#app')
